import React, { useState, useEffect } from 'react';
import { Card, Typography, Form, Input, Button, Divider } from 'antd';
import { CompanyInfo } from '../App';
import './CertificatePreview.css';

const { Title, Text } = Typography;

interface CertificatePreviewProps {
  companyInfo: CompanyInfo;
}

const CertificatePreview = ({ companyInfo }: CertificatePreviewProps) => {
  // 生成注册号码
  const generateRegistrationNumber = () => {
    const prefix = companyInfo.state === 'Colorado' ? 'CO' : 
                   companyInfo.state === 'Delaware' ? 'DE' :
                   companyInfo.state === 'Wyoming' ? 'WY' :
                   companyInfo.state === 'Nevada' ? 'NV' :
                   companyInfo.state === 'Florida' ? 'FL' :
                   companyInfo.state === 'California' ? 'CA' :
                   companyInfo.state === 'New York' ? 'NY' : 'XX';
    
    const randomNum = Math.floor(10000000 + Math.random() * 90000000);
    return `${prefix}${randomNum}`;
  };

  // 获取今日日期
  const getFormattedDate = () => {
    const date = new Date();
    return `${date.getFullYear()}年${date.getMonth() + 1}月${date.getDate()}日`;
  };
  
  // 获取州名中文翻译
  const getStateChinese = (stateCode: string) => {
    const stateMap = {
      'Delaware': '特拉华州',
      'Wyoming': '怀俄明州',
      'Nevada': '内华达州',
      'Florida': '佛罗里达州',
      'California': '加利福尼亚州',
      'New York': '纽约州',
      'Colorado': '科罗拉多州'
    };
    return stateMap[stateCode] || stateCode;
  };

  return (
    <div className="certificate-container">
      <div className="certificate-form-section">
        <Title level={4}>证书预览信息</Title>
        <div className="preview-info">
          <p><strong>选择州：</strong> {getStateChinese(companyInfo.state)}</p>
          <p><strong>公司名称：</strong> {companyInfo.companyName}</p>
          <p><strong>所有人：</strong> {companyInfo.ownerName}</p>
          <p><strong>注册号码：</strong> {companyInfo.registrationNumber || generateRegistrationNumber()}</p>
          <p><strong>注册日期：</strong> {companyInfo.registrationDate || getFormattedDate()}</p>
          <p><strong>注册地址：</strong> {companyInfo.address}</p>
        </div>
      </div>
      <Divider>证书预览</Divider>
      <div className="certificate-preview-section">
        <div className="certificate">
          <div className="certificate-header">
            <div className="state-seal"></div>
            <div className="certificate-title">
              <h2>{getStateChinese(companyInfo.state)}</h2>
              <h3>公司注册证书</h3>
              <h4>CERTIFICATE OF ORGANIZATION</h4>
              <h4>LIMITED LIABILITY COMPANY</h4>
            </div>
            <div className="state-seal"></div>
          </div>
          <div className="certificate-body">
            <p>本文件证明</p>
            <h2 className="company-name">{companyInfo.companyName}</h2>
            <p>已根据{getStateChinese(companyInfo.state)}法律正式注册成立为有限责任公司</p>
            <p>注册编号: <span className="certificate-info">{companyInfo.registrationNumber || generateRegistrationNumber()}</span></p>
            <p>注册日期: <span className="certificate-info">{companyInfo.registrationDate || getFormattedDate()}</span></p>
            <p>所有人: <span className="certificate-info">{companyInfo.ownerName}</span></p>
            <p>注册地址: <span className="certificate-info">{companyInfo.address}</span></p>
          </div>
          <div className="certificate-footer">
            <div className="official-signature">
              <p>州务卿</p>
              <div className="signature-line"></div>
              <p>Secretary of State</p>
            </div>
            <div className="certificate-seal"></div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default CertificatePreview;
